INSERT INTO `field` VALUES ('1353', '00200001', '', '放疗方式', 'rt_technique', '3', '4', '1', '', null, null, '放疗方式，自定义，参照SEERPCSM2015中Radiation。IMRT:调强适形放疗,IGRT:影像引导调强适形放疗,DGRT:剂量引导调强适形放疗,TOMO:螺旋断层放疗,3DCRT:三维适形放疗,2DRT:二维放疗,SBRT:立体定向放疗,IORT:术中放疗,VMAT:容积调强弧形放疗', '', null, '0', '0', '2019-04-23 00:05:33', null, null, null, null, null);
INSERT INTO `field` VALUES ('1354', '00200001', '', '靶区部位', 'target_body_part', '3', '4', '1', '', null, null, '靶区部位。GTV:肿瘤区,GTV-T:肿瘤原发灶,GTV-nd:淋巴结转移灶,CTV:临床靶区,CTV1:临近肿瘤的软组织或淋巴结,CTV2:淋巴结预防照射区,PTV:计划靶区,IVT:内移动靶区,OAR:危及器官,PRV:计划危及器官', '', null, '0', '0', '2019-04-23 00:05:33', null, null, null, null, null);
INSERT INTO `field` VALUES ('1355', '00200001', '', '放疗目的', 'rt_goal', '3', '4', '1', '', null, null, '姑息性放疗：诊断M1(或者诊断中含转移)后的放疗;术后辅助：手术后(手术开始时间3月内)的放疗(除外姑息放疗);术前新辅助：非M1手术前的放疗(除外姑息放疗);同期放化疗：在化疗开始时间两周内(除外姑息放疗及姑息化疗)化疗判断参考下面是否化疗的逻辑\"', '', null, '0', '0', '2019-04-23 00:05:33', null, null, null, null, null);
